import React, { useState } from 'react';
// import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';

import '../../App.css';



const VerRuta = () => {
  const [rutas] = useState([
    {
      idRuta: 'R105',
      pasajeros: [
        { idAsignacion: 'A105', nombrePasajero: 'PERSONA 1', direccion: 'calle petrohue sur 3528', telefono: '123456789' },
        { idAsignacion: 'A107', nombrePasajero: 'PERSONA 2', direccion: 'AV 205', telefono: '987654321' },
      ],
    },
    {
      idRuta: 'R106',
      pasajeros: [
        { idAsignacion: 'A104', nombrePasajero: 'PERSONA 3', direccion: 'AV 109', telefono: '456789123' },
        { idAsignacion: 'A112', nombrePasajero: 'PERSONA 4', direccion: 'AV 107', telefono: '789123456' },
      ],
    },
  ]);

  const [selectedRuta, setSelectedRuta] = useState(null);

  const handleVerDetalles = (ruta) => {
    setSelectedRuta(ruta);
  };

  const handleCerrarDetalles = () => {
    setSelectedRuta(null);
  };

  const abrirMapa = (direccion) => {
    const url = `https://www.google.com/maps/search/?api=1&query=${encodeURIComponent(direccion)}`;
    window.open(url, '_blank');
  };

  return (
    <div className='user-container'>
      <section className='user-section'>
        <h2 className='user-title'>RUTAS</h2>
        <table className='user-table'>
          <thead>
            <tr>
              <th className='user-th'>ID RUTA</th>
              <th className='user-th'>ACCIÓN</th>
            </tr>
          </thead>
          <tbody>
            {rutas.map((ruta, index) => (
              <tr key={index}>
                <td className='user-td'>{ruta.idRuta}</td>
                <td className='user-td'>
                  <button className='user-button' onClick={() => handleVerDetalles(ruta)}>Ver + Detalles</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </section>

      {selectedRuta && (
        <div className='modal'>
          <div className='modal-content'>
            <button className='close-button' onClick={handleCerrarDetalles}>×</button>
            <h3 className='modal-title'>Detalles de la Ruta: {selectedRuta.idRuta}</h3>
            <div className='passenger-details'>
              {selectedRuta.pasajeros.map((pasajero, index) => (
                <div key={index} className='detail-item'>
                  <p className='detail-label'>Nombre:</p>
                  <p className='detail-value'>{pasajero.nombrePasajero}</p>
                  <p className='detail-label'>Dirección:</p>
                  <p className='detail-value'>{pasajero.direccion}</p>
                  <p className='detail-label'>Teléfono:</p>
                  <p className='detail-value'>{pasajero.telefono}</p>
                  <hr />
                </div>
              ))}
            </div>
            <button className='map-button' onClick={() => abrirMapa(selectedRuta.pasajeros[0].direccion)}>
              Ver en Google Maps
            </button>
          </div>
        </div>
      )}
    </div>
  );
};

export default VerRuta;
